import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class LoginButton extends Component {
    state = {
      buttonStyle: {backgroundColor: 'blue', height: '100px', width: '200px',
                    position: 'relative', top: '500px', right: '500px'},
      textStyle: {fontFamily: 'helvetica', color: 'white', fontSize: '20px'}
    };
    render() {
        return (
            <button style={this.state.buttonStyle}>
              <span style={this.state.textStyle}> Log in </span>
            </button>
        );
    }
}

export default LoginButton;
